public class P1_StarPatternSQ {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int m = 5;
		int n = 5 ;
		
		for(int i=1;i<=m;i++) {
			
			
			for(int j=1; j<=n;j++) {
			
				
				System.out.print("*");
				
			}
			System.out.println();
		}
		
		
		
		
	}

}
